import React from "react";
import { Link } from "react-router-dom";
import "../styles/bootstrap.css";

function Navbar() {
  return (
    <div>
      <div>
        <button></button>
      </div>
      <div>
        <Link to="/"> Home </Link>
        <Link to="/portfolio"> Portfolio </Link>
        <Link to="/aboutme"> About </Link>
      </div>
    </div>
  );
}

export default Navbar;
